create table albums
(
    album_id     INT
        primary key,
    album_name   VARCHAR(255),
    album_type   VARCHAR(255),
    tracks       INT,
    genre        VARCHAR(255),
    release_year YEAR,
    duration     TIME
);




create table songs
(
    song_id      INT
        primary key,
    song_name    VARCHAR(255),
    album        VARCHAR(255)
        references albums,
    genre        VARCHAR(255),
    writer       VARCHAR(255),
    lead_singer  VARCHAR(255),
    release_year INT,
    duration     TIME,
    keyboardist  VARCHAR(255)
);


